public class StringDiff {

    public  static void main(String args[]){


        String  old = "eyJhbGciOiJIUzI1NiJ9..S5PLXZSAzSxr0gNtKzpmnFz1dELi8n4PJ8XvLRyqfdw";
        String working ="eyJhbGciOiJIUzI1NiJ9..DDhLbaQHYgZOTpvabjs3qHUkILyAI7bZ0xjOAQFh5aU";

        System.out.println("old" +  old.length());
        System.out.println("working" + working.length());

        for(int i =0;i<working.length();i++){

            if(!(working.charAt(i) == old.charAt(i))){
                System.out.println(i);
                break;
            }
        }
    }
}
